import React, { Component } from "react";

class UserItem extends Component {
  render() {
    const { id, login, avatar } = this.props.user;
    return (
      <div>
        <h3>shani</h3>
        <h2>{login}</h2>
        <img
          src={this.state.avatar}
          className="round-img"
          style={{ width: "60px" }}
        ></img>
        <h3>{this.state.login}</h3>
      </div>
    );
  }
}

export default UserItem;
